const translations = require('../taskTranslations')

function contextTask(size, lang) {
    const language = lang;
    const taskTranslations = translations.loadTaskTranslations(`contextTask_${language}`, language);

  if (size > 10) size = 10;

  var images = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/png;base64,",
  ];

  var correct = taskTranslations.correct;

  var incorrect = taskTranslations.incorrect;

  var instructions = taskTranslations.instructions;

  index = Math.floor(Math.random() * images.length);
  var image = images[index];
  var sentences = [];
  var correct_selected = [];
  var incorrect_selected = [];
  var correct_sentences = [];
  var incorrect_sentences = [];

  for (
    i = index * 5;
    i < index * 5 + 5;
    i++ //There are 5 correct sentences per image
  ) {
    correct_selected.push(correct[i]);
    incorrect_selected.push(incorrect[i]);
  }

  for (
    i = 0;
    i < size; //There are 5 correct sentences per image

  ) {
    if (Math.random() > 0.5) {
      if (correct_selected.length > 0) {
        var pointer = Math.floor(Math.random() * correct_selected.length);
        //sentences += i + 1 + ". " + correct_selected[pointer] + "\n";
        sentences.push(correct_selected[pointer])
        correct_sentences.push(correct_selected[pointer])
        correct_selected.splice(pointer, 1);
        i++;
      }
    } else {
      if (incorrect_selected.length > 0) {
        var pointer = Math.floor(Math.random() * incorrect_selected.length);
        //sentences += i + 1 + ". " + incorrect_selected[pointer] + "\n";
        sentences.push(incorrect_selected[pointer])
        incorrect_sentences.push(incorrect_selected[pointer])
        incorrect_selected.splice(pointer, 1);
        i++;
      }
    }
  }

  return {instructions, image, sentences, correct_sentences, incorrect_sentences}
}

function contextModel(size) {
  // Ex. Funct.
  var exfunctions = (0.25 + size * 1.2).toFixed(1);

  // Attention
  var attention = (3.4).toFixed(1);

  // Memory
  var memory = (2.63).toFixed(1);

  // Language
  var language = (1.45 + size * 1).toFixed(1);

  // Difficulty
  var difficulty = (1.05 + size * 0.75).toFixed(1);

  return {attention, memory, exfunctions, language, difficulty};
}

function taskObject(size, lang) {

  taskJSON = {}

  task = contextTask(size, lang)

  model = contextModel(size)

  taskJSON['model'] = model;
  taskJSON['instructions'] = task.instructions;
  taskJSON['image']= task.image;
  taskJSON['sentences'] = task.sentences;
  taskJSON['correct'] = task.correct_sentences;
  taskJSON['incorrect'] = task.incorrect_sentences;
  //console.log('taskJSON :', taskJSON)
  /*console.log('taskJSON :' + JSON.stringify(taskJSON, function(k,v) {
    if(v instanceof Array)
      return JSON.stringify(v);
    return v;
  }, 2).replace(/\\/g, '')
        .replace(/\"\[/g, '[')
        .replace(/\]\"/g,']')
        .replace(/\"\{/g, '{')
        .replace(/\}\"/g,'}'));
  // pretty print*/

  return taskJSON
}

module.exports = {
  contextTask,
  contextModel,
  taskObject
  }